// client/src/pages/Dashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Dashboard() {
  const [groceries, setGroceries] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const token = localStorage.getItem('token');
    axios
      .get('http://localhost:5000/api/groceries', {
        headers: { Authorization: `Bearer ${token}` }
      })
      .then(res => {
        setGroceries(res.data);
        setLoading(false);
      })
      .catch(err => {
        console.error(err);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <div className="p-6">Loading groceries...</div>;
  }

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">ðŸ›’ Grocery Manager â€” Dashboard</h1>
      {groceries.length === 0 ? (
        <p>No groceries found.</p>
      ) : (
        <ul className="space-y-2">
          {groceries.map(item => (
            <li key={item._id} className="p-3 bg-white shadow rounded">
              <span className="font-semibold">{item.name}</span> â€” â‚¹{item.price}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default Dashboard;
